CREATE TABLE jbtravel.seat
(
  seatid integer NOT NULL,
  planeid integer NOT NULL,
  seatname character varying(4) NOT NULL,
  seatposition character varying(10) NOT NULL,
  seatcategory character varying(10) NOT NULL DEFAULT 'Economy'::character varying,
  CONSTRAINT seat_pkey PRIMARY KEY (seatid)
);
ALTER TABLE jbtravel.seat OWNER TO postgres;


